import React from 'react'
import queryString from 'query-string'
import {useLocation } from 'react-router-dom'
import SVG from 'react-inlinesvg'


function DetailCareerPage() {
    const { search } = useLocation()
    const query = queryString.parse(search)
    return (
        <div>
            <h1>HALLO DETAIL PAGE</h1>
            <div className='shadow-lg mx-auto px-32 hover:bg-rcd_color_blue rounded-xl mt-8'>
                <div className="grid grid-cols-2">
                    <h2 className="font-semibold">Back End Developer</h2>
                    <h5>Available<span><SVG src="/img/available.svg" /></span></h5>
                </div>

            </div>
        </div>
    )
}

export default DetailCareerPage
